import React, { Fragment } from 'react';

export default class Log extends React.Component {
  state = {
    pers: [{ email: 'gdhdgh', password: 'ljoii' }],
  };
  changeEmile = (ev) => {
    this.setState({ email: ev.target.value });
  };
  changePassword = (ev) => {
    this.setState({ password: ev.target.value });
  };

  Ren = (ev) => {
    ev.preventDefault();
    this.props.Ren(this.state.pers);
  };
  render() {
    return (
      <Fragment>
        {this.state.pers.map((item) => {
          return (
            <form onSubmit={this.Ren}>
              <input
                type='email'
                placeholder='Email'
                onChange={this.changeEmail}
              />
              <input
                type='password'
                placeholder='Password'
                minLength='6'
                onChange={this.changePassword}
              />
              <button>
                <b> Login in</b>
              </button>
            </form>
          );
        })}
      </Fragment>
    );
  }
}
